import React from "react";
import { AiOutlineUser } from "react-icons/ai";
import { BsFiles } from "react-icons/bs";
import { TbSchool } from "react-icons/tb";

export const Categories = () => {
  const categories = [
    { name: "Work", files: 180, color: "purple", icon: BsFiles },
    {
      name: "Personal",
      files: 20,
      color: "emerald",
      icon: AiOutlineUser,
    },
    { name: "Videos", files: 40, color: "amber", icon: TbSchool },
    { name: "Audio", files: 10, color: "blue", icon: MdOutlineAudiotrack },
  ];

  return (
    <div className="flex flex-col gap-8">
      <h1 className="font-bodyFont text-3xl font-extrabold text-sky-950">
        Categories
      </h1>
      <div className="flex gap-4">
        {categories.map((category) => (
          <Category category={category} icon={category.icon} />
        ))}
      </div>
    </div>
  );
};
